/*Table structure for table `dtv_package` */

DROP TABLE IF EXISTS `dtv_package`;

CREATE TABLE `dtv_package` (
  `package_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '绘本内容组包id',
  `con_flag` char(1) DEFAULT '1' COMMENT '包内容类型 1：代表动漫或听书内容 2绘本',
  `package_name` varchar(20) DEFAULT '' COMMENT '包名',
  `first_letter` varchar(20) DEFAULT '' COMMENT '报名中文首字母，大写',
  `update_time` bigint(11) DEFAULT '0' COMMENT '更新时间',
  `create_staff_id` int(11) DEFAULT '0' COMMENT '创建人id',
  `package_thumd` varchar(30) DEFAULT '' COMMENT '海报图片',
  `package_image` varchar(30) DEFAULT '' COMMENT '打包图片',
  `statuz` char(1) DEFAULT '0' COMMENT '状态 1上架 0下架',
  `introd` varchar(300) DEFAULT '' COMMENT '故事简介',
  PRIMARY KEY (`package_id`)
) ENGINE=InnoDB AUTO_INCREMENT=106 DEFAULT CHARSET=utf8;

/*Data for the table `dtv_package` */

insert  into `dtv_package`(`package_id`,`con_flag`,`package_name`,`first_letter`,`update_time`,`create_staff_id`,`package_thumd`,`package_image`,`statuz`,`introd`) values (1,'2','和父母做朋友','HFMZPY',1460708783,1,'package/015418fbd6350073.png','package/015418fbc5460072.png','1','学会与父母相互关心，相互理解，及时与父母沟通，和父母做朋友。\r\n'),(2,'2','朋友间要互助','PYJYHZ',1460708775,1,'package/015418fba8b20071.png','package/015418fb9b9b0070.png','1','在日常生活中，有意识地教孩子学会帮助和求助他人，这有助于孩子和他人的情感交流，对孩子生存技巧、与人友好相处及合作精神的培养，都大有好处，可谓一举多得。\r\n'),(3,'2','生活好习惯','SHHXG',1460708769,1,'package/015418fb8255006f.png','package/015418fb73fc006e.png','1','启发儿童的想象力，记忆力和创造力，帮助孩子从小养成良好习惯，孩子选择一种好习惯收获一种快乐的成就感，选择一种坏习惯就承担一种不良后果。\r\n'),(4,'2','智慧城','ZHC',1460708760,1,'package/015418fb4f5d006d.png','package/015418fb3da4006c.png','1','结合孩子的成长需求，从性格培养、心理健康、生活习惯、情绪表达、认知能力等多个方面开发孩子各方面潜能，让孩子成为最优秀的自己。\r\n'),(5,'2','好品质惹人爱','HPZRRA',1460708753,1,'package/015418fb1f9f006b.png','package/015418fb0d05006a.png','1','良好的品质需要从孩子小的时候开始培养，在日常生活和学习中，从小处着手，在细节中有意识地培养孩子的品质，更容易让孩子领悟到其中的意义。\r\n'),(6,'1','中华德育故事第一部','ZHDYGSDYB',1460708555,1,'package/015418f49b160043.png','package/015418f48c230042.png','1','这是一部流传千古，感人至深的经典，是一部真正受益终身的动画片，它可以真正奠定孩子做人根基，也是一部真正改变您人际关系的动漫宝典。\r\n'),(7,'1','中华德育故事第二部','ZHDYGSDEB',1460708552,1,'package/015418f46ffc0041.png','package/015418f45bb30040.png','1','这是一部流传千古，感人至深的经典，是一部真正受益终身的动画片，它可以真正奠定孩子做人根基，也是一部真正改变您人际关系的动漫宝典。\r\n'),(8,'1','少儿安全教育','SEAQJY',1460081927,1,NULL,NULL,'0',''),(9,'1','幼儿安全教育','YEAQJY',1460708534,1,'package/015418f43a11003f.png','package/015418f429e7003e.png','1','从与孩子生活密切相关的家庭环境，公共环境，饮食安全等多个方面入手，寓教于乐；同时，配备了相关的育儿安全建议，方便家长进行安全教育方面的亲子互动。希望能帮助孩子们尽早掌握安全知识，树立安全意识。\r\n'),(10,'1','消防短片','XFDP',1460708516,1,'package/015418f408e4003d.png','package/015418f3fab8003c.png','1','主人公咔咔带领他的朋友为孩子们讲述消防知识，增强消防意识。是一部不错的消防知识短片。\r\n'),(11,'1','公益剧第一部','GYJDYB',1460708478,1,'package/015418f3c789003b.png','package/015418f3b7c6003a.png','1','通过可可小爱两个可爱的卡通形象，简单易懂的动画内容，使孩子们从中学习到自身安全、品德礼貌、生活习惯等各个方面的知识，是教育孩子不可或缺的小助手。\r\n'),(12,'1','公益剧第二部','GYJDEB',1460708488,1,'package/015418f396750039.png','package/015418f384b00038.png','1','通过可可小爱两个可爱的卡通形象，简单易懂的动画内容，使孩子们从中学习到自身安全、品德礼貌、生活习惯等各个方面的知识，是教育孩子不可或缺的小助手。\r\n'),(13,'1','可可小爱春节篇','KKXACJP',1460708467,1,'package/015418f333a10037.png','package/015418f3228d0036.png','1','噼里啪啦放炮啦！在孩子眼中春节应该是最高兴的节日了，穿新衣、放炮仗，全家团圆。但是高兴的同时仍要注意自身安全，别忘了回家看看自己的爷爷奶奶，也别忘了对坚守岗位的叔叔阿姨说一声谢谢。\r\n'),(14,'1','可可小爱雾霾篇','KKXAWMP',1460708459,1,'package/015418f303580035.png','package/01542d4a1a350001.png','1','社会的快速发展给环境带了了严重的负担，雾霾一直持续不散，小朋友们不要慌张，我们来一起学习一下如何有效防霾。\r\n'),(15,'1','社会主义价值观','SHZYJZG',1460708446,1,'package/015418f2d1750033.png','package/01542d4aac010002.png','1','如何学会用法律来保护自己，邻里间和睦和睦相处，文明出行等等培养孩子价值观的知识都可以在这里获得，是孩子启蒙最好的老师！\r\n'),(16,'1','可可小爱童谣','KKXATY',1460708436,1,'package/015418f29e240031.png','package/015418f28d780030.png','1','用童谣的方式展示身边点点滴滴需要注意的问题，比如不要酒后驾车，扔玻璃制品的垃圾要处理好防止割伤清洁员阿姨等等。可以在轻松愉快的氛围中让孩子学到生活中方方面面的小知识。\r\n'),(17,'1','文明旅游','WMLY',1460708427,1,'package/015418f2662b002f.png','package/015418f254ff002e.png','1','快背好小书包准备去旅游啦，流连于美丽景色中的时候小朋友们也要养成文明旅行的好习惯，快来看看都需要注意什么吧！\r\n'),(18,'1','国学三字经','GXSZJ',1460708395,1,'package/015418f1d182002d.png','package/015418f1c15b002c.png','1','内置了国学经典三字经，由动画形式将三字经演绎出来，生动的动画，一定会让您的孩子爱不释手。\r\n'),(19,'1','古诗','GS',1460708386,1,'package/015418f1a847002b.png','package/015418f19810002a.png','1','幼儿益智必读，学前必备，精编精选。帮助幼儿早期教育的通俗类读物，它集寓教娱乐为一身，让孩子在学习中掌握知识，开发智力。\r\n'),(20,'1','唐诗','TS',1460083903,1,NULL,NULL,'0',''),(21,'1','至善之道','ZSZD',1460084104,1,NULL,NULL,'0',''),(22,'1','小笨熊成长阶梯','XBXCZJT',1460708361,1,'package/015418f173350029.png','package/015418f162350028.png','1','本故事将趣味性和知识性融为一体，语言活泼，图文并茂，寓教于乐，是宝宝成长路上的好伙伴！\r\n'),(23,'1','小笨熊励志教育','XBXLZJY',1460708344,1,'package/015418f12cf50027.png','package/015418f11b610026.png','1','本故事将趣味性和知识性融为一体，语言活泼，图文并茂，寓教于乐，内容包括趣味动物故事、童话故事、幼教故事等等，是宝宝成长路上的好伙伴！\r\n'),(24,'1','小笨熊知识教育','XBXZSJY',1460708317,1,'package/015418f0fd110025.png','package/015418f0e7810024.png','1','本故事将趣味性和知识性融为一体，语言活泼，图文并茂，寓教于乐，内容包括数学知识、英语知识、成语学习等等，是宝宝成长路上的好伙伴！\r\n'),(25,'1','体育系列动画','TYXLDH',1460084884,1,NULL,NULL,'0',''),(26,'1','妇幼保健动画','FYBJDH',1460084901,1,NULL,NULL,'0',''),(27,'1','亲子成长','QZCZ',1460708307,1,'package/015418f0ac6e0023.png','package/015418f0960d0022.png','1','跟着视频一起学习，做游戏，做手工，丰富家长和宝贝们在一起的休闲时光，更可以通过互动增进家长和宝贝们之间的感情。\r\n'),(28,'1','中华弟子规','ZHDZG',1460085097,1,NULL,NULL,'0',''),(29,'1','科普乐园','KPLY',1460085181,1,NULL,NULL,'0',''),(31,'2','幼儿故事','YEGS',1460708741,1,'package/015418fad7e90069.png','package/015418fac0f70068.png','1','幼儿故事以其生动的情节、优美的语言、活泼可爱的形象，来吸引幼儿，幼儿可在童话世界里自由翱翔，不仅可以丰富幼儿的知识，对促进幼儿想象力、创造力的发展也具有不可替代的作用。\r\n'),(32,'2','少儿故事','SEGS',1460708734,1,'package/015418faa6990067.png','package/015418fa97d00066.png','1','少儿故事寓教于乐，适合少儿的心理特点，开启智慧，丰富头脑，能有效地拓宽他们的知识面，培养孩子对知识的感知兴趣，对孩子的课外启蒙教育有很好的效果。\r\n'),(33,'1','儿童故事','ETGS',1460708297,1,'package/015418f063f10021.png','package/015418f053040020.png','1','儿童故事指具有故事基本特征的内容单纯,篇幅短小,与儿童的接受相适应,供儿童阅读和聆听的叙事性文学体裁\r\n'),(34,'1','讲故事','JGS',1460708289,1,'package/015418f01bfe001f.png','package/015418f00a22001e.png','1','安徒生童话,格林童话,成语故事,伊索寓言等宝贝想听的故事这里都有。\r\n'),(35,'2','名人故事汇','MRGSH',1460708728,1,'package/015418fa7a9a0065.png','package/015418fa6a310064.png','1','名人故事，讲述的都是做人的大道理，传承的都是中华的美德，让孩子多接触这样的经典故事，让孩子接受这样的正能量教育，无疑是对孩子的大爱。\r\n'),(36,'2','成语故事第一部','CYGSDYB',1460093337,1,NULL,NULL,'0',''),(37,'2','成语故事第二部','CYGSDEB',1460093921,1,NULL,NULL,'0',''),(38,'2','成语故事第三部','CYGSDSB',1460093935,1,NULL,NULL,'0',''),(39,'2','趣味动物城','QWDWC',1460708718,1,'package/015418fa32bd0063.png','package/015418fa22420062.png','1','孩子在唱儿歌的过程中认识动物，听到它们的叫声，看到它们的卡通形象，通过给孩子们视觉、听觉等多方面的刺激,方便宝宝对动物的认识,促进宝宝大脑的发育。\r\n'),(40,'2','中国故事荟萃','ZGGSHC',1460708711,1,'package/015418f9fdca0061.png','package/015418f9ed860060.png','1','所叙述的故事，大都是中外名人少年时期发生的。尽管故事中所叙述的内容都不是今天发生的，但所阐述的道理，对当今少年儿童具有很大的指导意义，对少年儿童的健康成长有一定帮助。\r\n'),(41,'2','童画天地','THTD',1460708701,1,'package/015418f9c91d005f.png','package/015418f9b964005e.png','1','为您提供精彩丰富的儿童童话故事,包括安徒生童话,格林童话,成语故事,伊索寓言,睡前故事等中外著名童话故事。\r\n'),(43,'2','童趣故事','TQGS',1460708695,1,'package/015418f999da005d.png','package/015418f980f2005c.png','1','童趣故事是孩子喜欢的一些故事,受到了很多小朋友的喜爱,让故事带给孩子快乐。\r\n'),(44,'1','五行少年','WXSN',1460708275,1,'package/015418efdbef001d.png','package/015418efccbe001c.png','1','本片是以秦文化历史为背景和少年励志为题材创作的大型电视动画片，五位主人宫分别是代表金、木、水、火、土的五个少年在战火纷飞的秦朝，他们为了平定战乱拯救天下百姓踏上艰难的征程。\r\n'),(45,'1','阿狸绘本','ALHB',1460098587,1,NULL,NULL,'0',''),(46,'1','阿狸梦之岛','ALMZD',1460098652,1,NULL,NULL,'0',''),(47,'2','阿狸故事','ALGS',1460098718,1,NULL,NULL,'0',''),(48,'1','神鹤丹丹','SHDD',1460708262,1,'package/015418efb33a001b.png','package/015418efa453001a.png','1','《神鹤丹丹》以生活在天宫的小神鹤丹丹，欲求阳光神炼就的宝石红顶，经百鸟仙子指点，下到凡间做好事积德行善为明线，以神鹤丹丹求索宝石顶的过程，是其通过自觉修养而培育了高尚品德的过程为暗线，展现“丹丹”在适应自然生态与求得动物间和睦共处中，使自己逐渐成长，并最终实现愿望的艰辛历程。\r\n'),(49,'1','咔咔历险记','KKLXJ',1460708250,1,'package/015418ef83400019.png','package/015418ef72560018.png','1','影片讲述了小姑娘雨果在一个充满动物和神奇植物的美丽国度里的惊险刺激的冒险故事。\r\n'),(50,'1','钢铁飞龙','GTFL',1460708239,1,'package/015418ef50ff0017.png','package/015418ef410f0016.png','1','讲述了在2026年，地球环境恶化，人类陷入重大生态危机。环保基地决定挑选一批优秀成员组成飞龙环保队，调查地球环境危机的原因。\r\n'),(51,'1','木木村淘气虫虫','MMCTQCC',1460708219,1,'package/015418ef202e0015.png','package/015418ef0ef60014.png','1','木木村的淘气虫虫们生活在森林深处的一个神秘而又古老的精灵部落，聪明智慧的螳螂爷爷和蝉阿姨带着一群古灵精怪的可爱宝宝们一起快乐的生活着。\r\n'),(52,'1','成长乐园','CZLY',1460708208,1,'package/015418eee3f00013.png','package/015418eecdef0012.png','1','内容涵盖孩子成长、教育、学习、培养等各方面的内容。关注孩子的成长,让孩子追求梦想,学会快乐,拥有自由,让生命充满活力,让生活充满阳光!\r\n'),(53,'1','熊小米','XXM',1460708198,1,'package/015418eda177000f.png','package/015418ed8659000e.png','1','友谊的的天空蓝蓝的，友谊的彩虹弯弯的，友谊的世界是美丽的。快来和熊小米成为好朋友吧，一起玩耍、成长。\r\n'),(54,'1','星梦园第一季','XMYDYJ',1460099063,1,NULL,NULL,'0',''),(55,'1','聪明伦文叙','CMLWX',1460099083,1,NULL,NULL,'0',''),(56,'1','肥猫正传','FMZC',1460099110,1,NULL,NULL,'0',''),(57,'1','肥猫瘦狗精灵鼠','FMSGJLS',1460099134,1,NULL,NULL,'0',''),(58,'1','帮帮龙出动第一季','BBLCDDYJ',1460099196,1,NULL,NULL,'0',''),(59,'1','帮帮龙出动第二季','BBLCDDEJ',1460708181,1,'package/015418edf4890011.png','package/01542d49a87b0000.png','1','勇敢的队长Rex，聪明的博士Tomo，惹人喜爱的Viki，调皮的Ping，他们来自宇宙的保卫星球