2','西游记','XYJ',1460708665,1,'package/015418f82ed40059.png','package/015418f81c8a0058.png','1','本领高强的孙悟空既能上天入地又有72般变化，不知他会如何保护唐僧一路取经，这一路上又会碰到什么磨难呢？\r\n'),(90,'1','武当虹少年','WDHSN',1460103155,1,NULL,'package/01581eff1eb80000.jpg','0',''),(91,'2','神奇大自然','SQDZR',1460708658,1,'package/015418f7dcc50057.png','package/015418f7c8e50056.png','1','鬼斧神工的大自然造就了很多奇妙的事情，为什么会有日食月食，为什么我会有一个跟我一模一样的兄弟？想要知道答案的话就快快点进来看看吧！\r\n'),(92,'2','生活小常识','SHXCS',1460708651,1,'package/015418f7acf70055.png','package/015418f798cd0054.png','1','生活中一些常见的现象在孩子眼中也许会觉得很神奇，为什么爸爸有胡子而妈妈没有，为什么太阳公公晚上不会出来呢？这些问题都可以在这里找到答案。\r\n'),(93,'2','百科知识','BKZS',1460708642,1,'package/015418f772150053.png','package/015418f762590052.png','1','形形色色的生活知识都可以在这里找到答案，我们是如何听到声音的，宝贝为什么要换牙等等，快快来带着小朋友一起学习吧\r\n'),(94,'1','英文小天才','YWXTC',1460708118,1,'package/015418ecd9ec0009.png','package/015418ecc9a30008.png','1','在全球经济一体化的今天，全世界的家长都认识到掌握世界通用语言——英语的重要性。本书通过图文并茂，形象生动的表现方式，帮助小朋友更好的学习英语。在线学习英语儿歌，赢在起跑线。\r\n'),(95,'2','英文儿歌','YWEG',1460708627,1,'package/015418f738aa0051.png','package/015418f727c30050.png','1','精选最为经典的英文儿歌，小朋友可以在学习儿歌的同时学习了英语，是件非常有意义的事情。\r\n'),(96,'1','十万个为什么','SWGWSM',1460708102,1,'package/015418ec9f980007.png','package/015418ec8ae30006.png','1','飞机为什么要迎风起落，焚烧垃圾为啥不好，小熊嘟啦与你一起学习生活百科，了解到许许多多奇妙有趣的为什么。\r\n'),(97,'2','好孩子之歌','HHZZG',1460708617,1,'package/015418f7080f004f.png','package/015418f6f4a7004e.png','1','通过朗朗上口的儿歌培养孩子的生活习惯、文明礼貌以及各种生活小知识，娱乐学习两不误。\r\n'),(98,'2','经典童谣','JDTY',1460708609,1,'package/015418f6d4b9004d.png','package/015418f6c593004c.png','1','人人都会的儿歌童谣，熟悉的内容不仅孩子喜欢还会勾起家长的童年回忆。\r\n'),(99,'2','亲子歌','QZG',1460708597,1,'package/015418f6a3fc004b.png','package/015418f6947b004a.png','1','亲子儿歌多反映儿童的生活情趣，传播生活，生产知识等。词句音韵流畅，容易上口，节奏轻快，既可以二人对唱，也可以一人自唱。\r\n'),(100,'2','童趣园','TQY',1460708590,1,'package/015418f67b4c0049.png','package/015418f66bf70048.png','1','童趣可爱的小故事，简单易懂的道理，活泼可爱的卡通形象，是小孩子对各方面事物的启蒙儿歌。\r\n'),(101,'2','学唱乐园','XCLY',1460708581,1,'package/015418f652e60047.png','package/015418f643110046.png','1','儿歌是唤起宝宝注意，锻炼听力，培养语感，与宝宝交流情感的好方法。给宝宝学儿歌容易吸引宝宝注意力，还能促进宝宝智力和语言能力发育，一举多得。\r\n'),(102,'1','开心儿歌','KXEG',1460708089,1,'package/015418ec4e1f0005.png','package/015418ec39a50004.png','1','以幼儿童为接受对象，富有童真童趣，形象生动，易教易懂易记，贴近小朋友的现实生活，是小朋友最喜爱的精神食粮，它对于儿童语言的培养具有极为重要的意义。儿歌虽然短小，却是集德育、智育、美育于一体的万花筒。\r\n'),(103,'1','3D儿歌','3DEG',1460708080,1,'package/015418ebf2620003.png','package/015418ebcb7a0002.png','1','属于全国首推3D儿歌视频,开拓了国内首家3D儿歌动漫形象的新局面.3D版的动画给儿童带来的视觉体验大大提升了,同时,十足的新鲜感让孩子更容易接收儿歌里面所蕴含的教育成分.\r\n'),(104,'1','动物儿歌','DWEG',1460708068,1,'package/015418eb9bbe0001.png','package/015418eb61f10000.png','1','小宝贝，你最喜欢的动物是什么呀？动物儿歌专辑里又很多可爱的小动物哦，赶快来听一听吧。\r\n'),(105,'2','动物好朋友','DWHPY',1460708570,1,'package/015418f61fcf0045.png','package/015418f60c6d0044.png','1','动物是人类最好的朋友，通过各种小动物的形象生动的表现一个个可爱的故事，培养孩子对各种动物了解及好习惯的养成。\r\n');

/*Table structure for table `dtv_package_con` */

DROP TABLE IF EXISTS `dtv_package_con`;

CREATE TABLE `dtv_package_con` (
  `package_id` int(11) NOT NULL,
  `con_id` int(11) NOT NULL,
  `cp_id` int(11) DEFAULT '0',
  `statuz` char(1) DEFAULT '0' COMMENT '1上架0下架',
  `is_free` char(1) DEFAULT '0' COMMENT '1是免费，0是收费',
  `order_code` int(11) DEFAULT '0' COMMENT '排序码',
  `read_times` int(11) DEFAULT '0' COMMENT '点播次数',
  `update_time` bigint(11) DEFAULT '0' COMMENT '更新时间',
  `create_staff_id` int(11) DEFAULT '0' COMMENT '创建人id',
  PRIMARY KEY (`package_id`,`con_id`)
