/*Table structure for table `prod_product` */

DROP TABLE IF EXISTS `prod_product`;

CREATE TABLE `prod_product` (
  `prod_code` varchar(30) NOT NULL DEFAULT '',
  `prod_name` varchar(30) DEFAULT '' COMMENT '故事名称',
  `statuz` char(1) DEFAULT '1',
  `price` float DEFAULT '0',
  `is_free` char(1) DEFAULT '1' COMMENT '1收费 0免费',
  `update_time` varchar(20) DEFAULT '',
  `create_staff_id` bigint(11) DEFAULT '0' COMMENT '创建人ID',
  `hd` varchar(1) DEFAULT '1' COMMENT '1 高清 0标清',
  `charge_time` varchar(20) DEFAULT '' COMMENT '收费开始时间',
  PRIMARY KEY (`prod_code`),
  KEY `prod_code` (`prod_code`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

